import React from 'react';

const ReduxCounter = React.memo(({ number, onIncrease, onDecrease }) => {
    return (
        <>
            <h1>바닐라 리덕스 카운터</h1>
            <span>{number}</span>
            <button onClick={onIncrease}>+1</button>
            <button onClick={onDecrease}>-1</button>
        </>
    );
});

export default ReduxCounter;
